INSERT INTO `service` VALUES (1,'130421a','The Forth Circle (Morning)','<p>Steam-hauled by 60009 <em>Union of South Africa</em></p>\r\n<p><em>Over the Forth Bridge, along the Fife Coast and round the Fife Circle to Dunfermline, then along the shores of the Firth of Forth to Kincardine and through Alloa to Stirling, and returning through Larbert and Falkirk.</em></p>',0,'2013-04-21','Lunch',1,10.00,'Lunch',0,0.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,4),(2,'130421b','The Forth Circle (Afternoon)','<p>Steam-hauled by 60009 <em>Union of South Africa</em></p>\r\n<p>Over the Forth Bridge, along the Fife Coast and round the Fife Circle to Dunfermline, then along the shores of the Firth of Forth to Kincardine and through Alloa to Stirling, and returning through Larbert and Falkirk.</p>',0,'2013-04-21','Dinner',1,10.00,'Lunch',0,0.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,4),(3,'130504','The West Highlander to Fort William and Mallaig','<p><em>From the scenic West Highland Line view the splendour of Loch Long, Loch Lomond, Rannoch Moor, Monessie Gorge, Ben Nevis, Glenfinnan and Morar.</em></p>',0,'2013-05-04','Breakfast',1,8.00,'Lunch',1,10.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,2),(4,'130525','The Lochalsh Special to Plockton and Kyle of Lochalsh','<p><em>Over the Highland Line via Pitlochry, Blair Atholl, Drumochter Summit, Aviemore and Culloden to Inverness, then via Dingwall, Garve and the spectacular scenery along Loch Carron to <strong>Plockton</strong> and <strong>Kyle of Lochalsh</strong>.</em></p>',0,'2013-05-25','Breakfast',1,8.00,'Lunch',1,10.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,16),(5,'130601','The West Highlander to Mallaig','<p><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor, and Monessie Gorge. From Fort William the train is steam-hauled to and from <strong>Mallaig</strong> along the route of \'The Jacobite\' with views of Ben Nevis, Loch Eil, Glenfinnan and Morar.</em></p>',0,'2013-06-01','Breakfast',1,8.00,'Lunch',1,10.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,16),(6,'130601a','The West Highlander to Fort William','<p><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor, and Monessie Gorge and spend the afternoon exploring <strong>Fort William</strong>.</em></p>',0,'2013-06-01','Breakfast',1,8.00,'Lunch',0,10.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,16),(7,'130608','The Highlander to Aviemore and Inverness','<p><em>North along the East Coast, over the Forth Bridge and through Fife to Perth, then along the Highland Line through Dunkeld, Pitlochry, Blair Atholl and over Drumochter Summit, the highest point on the British railway network. Passengers may leave the train at <strong>Aviemore</strong> for a trip on the Strathspey Railway through Boat of Garten to Broomhill. Alternatively remain aboard over Slochd Summit and past Culloden to <strong>Inverness</strong>, the Highland Capital.</em></p>',0,'2013-06-08','Breakfast',1,8.00,'Dinner',1,12.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,16),(8,'130616a','The Fife Circle with 60163 \'Tornado\'','<p><em>Steam special hauled by Britain&rsquo;s newest main-line steam locomotive. Morning departure from Edinburgh round the Edinburgh Suburban Circle then over the Forth Bridge, along the Fife Coast to Kirkcaldy and round the Fife Circle to Dunfermline returning over the Forth Bridge.</em></p>',0,'2013-06-16','Lunch',1,10.00,'Lunch',0,0.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,16),(9,'130616b','The Forth Circle with 60163 \'Tornado\'','<p><em>Steam special hauled by Britain&rsquo;s newest main-line steam locomotive. Afternoon departure round the Edinburgh Suburban Circle, then through Linlithgow and Falkirk to Stirling; continuing through Alloa, Kincardine and along the shores of the Firth of Forth, returning via Dunfermline, Kirkcaldy and over the Forth Bridge.</em></p>',0,'2013-06-16','Dinner',1,12.00,'Lunch',0,0.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,2),(10,'130504a','The West Highlander to Fort William','<p><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor, and Monessie Gorge and spend the afternoon exploring <strong>Fort William</strong>.</em></p>',0,'2013-05-04','Breakfast',1,8.00,'Lunch',0,10.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,16),(11,'130914','Oban Special','<p><span><em>Along the east coast and Firth of Tay then across central Scotland through Gleneagles, Stirling and Glasgow. Then over the scenic West Highland Line by Loch Lomond, Loch Awe, Ben Cruachan and the Pass of Brander to Oban with its views of Mull across the Firth of Lorn.</em></span></p>',0,'2013-09-14','Breakfast',1,8.00,'Lunch',0,0.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,16),(12,'130921','Blackpool Special','<p><span><em>Along the West Coast Main Line to the resort with its famous tower and Golden Mile. <br />Return over the scenic Settle &amp; Carlisle line.</em></span></p>',0,'2013-09-21','Breakfast',1,8.00,'Dinner',1,12.00,'Dinner',0,12.00,'Not used',0,0.00,10.00,0,16),(13,'130928','The Cumbrian Coast','<p><span><em>Via the East Coast and Tyne Valley then along the Cumbrian Coast line to Ravenglass (for Ravenglass &amp; Eskdale Railway) and Grange-over-Sands (for Lake Windermere Cruise). </em></span></p>',0,'2013-09-28','Breakfast',1,8.00,'Dinner',1,12.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,16),(14,'131026','The West Highlander to Fort William','<p><span><em>Double-headed steam special southbound on the scenic West Highland Line with stunning views of Loch Long, Loch Lomond, Rannoch Moor, Monessie Gorge and Ben Nevis. Diesel-hauled northbound.<br /></em></span></p>',0,'2013-10-26','Breakfast',1,8.00,'Lunch',1,10.00,'Dinner',1,12.00,'Not used',0,0.00,10.00,0,16),(15,'140427a','The Forth Circle (Morning)','<p><strong>Steam-hauled by 60009 <em>Union of South Africa</em></strong></p>\r\n<p><em>Morning steam special round the Forth Circle; over the Forth Bridge, along the Fife Coast and round the Fife Circle to Dunfermline, then along the shores of the Firth of Forth to Kincardine and through Alloa to Stirling, and returning through Larbert and Falkirk.</em></p>',1,'2014-04-27','Lunch',1,12.00,'Lunch',0,0.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,16),(16,'140427b','The Forth Circle (Afternoon)','<p><strong>Steam-hauled by 60009 <em>Union of South Africa</em></strong></p>\r\n<p><em>Morning steam special round the Forth Circle; over the Forth Bridge, along the Fife Coast and round the Fife Circle to Dunfermline, then along the shores of the Firth of Forth to Kincardine and through Alloa to Stirling, and returning through Larbert and Falkirk.</em></p>',1,'2014-04-27','Dinner',1,12.00,'Lunch',0,0.00,'Dinner',0,0.00,'Not used',0,0.00,10.00,0,16),(17,'140510','The Lochalsh Special','<p><span><em>The Highland Line via Blair Atholl, Drumochter, Aviemore and Culloden to Inverness, then via Dingwall, Garve and the spectacular scenery along Loch&nbsp;Carron to Plockton and Kyle&nbsp;of&nbsp;Lochalsh.</em></span></p>',1,'2014-05-10','Breakfast',1,10.00,'Lunch',1,12.00,'Dinner',1,15.00,'Not used',0,0.00,10.00,0,16),(18,'140524','The West Highlander to Mallaig','<p><span><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor and the Monessie Gorge. After a short break in Fort William continue on the train steam-hauled to and from Mallaig with views of Ben Nevis, Loch Eil, Glenfinnan and Morar.</em></span></p>',1,'2014-05-24','Breakfast',1,10.00,'Lunch',1,12.00,'Dinner',1,15.00,'Not used',0,0.00,10.00,0,16),(19,'140524a','The West Highlander to Fort William','<p><span><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor and the Monessie Gorge and spend the afternoon in Fort William.</em></span></p>',1,'2014-05-24','Breakfast',1,10.00,'Lunch',0,0.00,'Dinner',1,15.00,'Not used',0,0.00,10.00,0,16),(20,'140607','The West Highlander to Mallaig','<p><span><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor and the Monessie Gorge. After a short break in Fort William continue on the train steam-hauled to and from Mallaig with views of Ben Nevis, Loch Eil, Glenfinnan and Morar.</em></span></p>',1,'2014-06-07','Breakfast',1,10.00,'Lunch',1,12.00,'Dinner',1,15.00,'Not used',0,0.00,10.00,0,16),(21,'140607a','The West Highlander to Fort William','<p><span><em>From the scenic West Highland Line view Loch Long, Loch Lomond, Rannoch Moor and the Monessie Gorge and spend the afternoon in Fort William.</em></span></p>',1,'2014-06-07','Breakfast',1,10.00,'Lunch',0,0.00,'Dinner',1,15.00,'Not used',0,0.00,10.00,0,16),(22,'140621','Chester & North Wales','<p><span><em>Along the West Coast Main Line over Beattock and Shap summits for a visit to the historic city of Chester, or remain on board for a trip along the North Wales Coast to Llandudno Junction and Bangor, or cross the Britannia Bridge over the Menai Strait to Anglesey and pass through Llanfairpwllgwyngyllgogerychwyrndrobwllllantysiliogogogoch before reaching Holyhead.</em></span></p>',1,'2014-06-21','Breakfast',1,10.00,'Lunch',0,0.00,'Dinner',1,15.00,'Not used',0,0.00,10.00,0,16);
